import React from "react";
import classes from './MyPosts.module.css'
import Post from './Post/Post'
import {addPostActionCreator,addNewPostTextActionCreator} from './../../../Redux/content-reducer'
import MyPosts from "./MyPosts";

const MyPostsContainer = (props) => {
console.log(props)



    let onClickHandler = () => {

       props.dispatch(addPostActionCreator())

    }



    let onChangeHandler = (text) => {

       props.dispatch(addNewPostTextActionCreator(text))
    }

    return (
        <div>
            <MyPosts addPost={onClickHandler} addNewPostText={onChangeHandler} myPosts={props.myPosts}/>
        </div>
    )
}


export default MyPostsContainer
